import{_ as e,o as a,c as n,a as i}from"./app.56059bde.js";var t="/aktivitaeten/BDM-2024-12/00_12-2024.jpg",r="/aktivitaeten/BDM-2024-12/01_12-2024.jpg",s="/aktivitaeten/BDM-2024-12/02_12-2024.jpg",d="/aktivitaeten/BDM-2024-12/03_12-2024.jpg",l="/aktivitaeten/BDM-2024-12/04_12-2024.jpg",m="/aktivitaeten/BDM-2024-12/05_12-2024.jpg",o="/aktivitaeten/BDM-2024-12/06_12-2024.jpg",u="/aktivitaeten/BDM-2024-12/07_12-2024.jpg",g="/aktivitaeten/BDM-2024-12/08_12-2024.jpg",c="/aktivitaeten/BDM-2024-12/09_12-2024.jpg",p="/aktivitaeten/BDM-2024-12/10_12-2024.jpg",_="/aktivitaeten/BDM-2024-12/11_12-2024.jpg",h="/aktivitaeten/BDM-2024-12/12_12-2024.jpg",k="/aktivitaeten/BDM-2024-12/13_12-2024.jpg",B="/aktivitaeten/BDM-2024-12/14_12-2024.jpg",D="/aktivitaeten/BDM-2024-12/15_12-2024.jpg",v="/aktivitaeten/BDM-2024-12/16_12-2024.jpg",M="/aktivitaeten/BDM-2024-12/17_12-2024.jpg",b="/aktivitaeten/BDM-2024-12/18_12-2024.jpg",f="/aktivitaeten/BDM-2024-12/19_12-2024.jpg";const w={},j=i('<h1 id="bilder-des-monats-dezember-2024" tabindex="-1"><a class="header-anchor" href="#bilder-des-monats-dezember-2024" aria-hidden="true">#</a> Bilder des Monats Dezember 2024</h1><p>DF9HC hatte einen Nachmittag Zeit in Berlin. Zuerst ging&#39;s in den Britzer Garten der bisher erst einmal in CW aktiviert worden war. Auf einem kleinen H\xFCgel kurz hinter dem Eingang wurde die DF-Vertical und FT-891 aufgebaut und in einer knappen Stunde 57 QSOs gemacht, auch etwas DX nach Nordamerika war dabei. Danach ging es noch auf das Tempelhofer Feld (DE-0169) und von dort waren es dann 32 QSOs in einer knappen Stunde, zum ersten Mal kam Kuba ins Logbuch. Als kr\xF6nender Abschluss kam DL7DL vorbei mit hei\xDFem Tee und es wurde gekl\xF6nt anstatt gefunkt.</p><p><img src="'+t+'" alt="Bilder des Monats"><img src="'+r+'" alt="Bilder des Monats"><img src="'+s+'" alt="Bilder des Monats"><img src="'+d+'" alt="Bilder des Monats"><img src="'+l+'" alt="Bilder des Monats"><img src="'+m+'" alt="Bilder des Monats"></p><p>DB6NL hat bei einer Anreise nach Aachen einen Abstecher zum Nationalpark Eifel gemacht. Dort gibt es vermutlich den einzigen 4-fer in NRW. Bei 0 Grad und leichtem Graupel kamen in einer knappen Stunde 18 QSOs ins Log. Mit 10W konnten leider nicht so viele andere Parks gejagt werden, da die Stationen lange Pileups hatten und da der Punch fehlte.</p><p><img src="'+o+'" alt="Bilder des Monats"><img src="'+u+'" alt="Bilder des Monats"><img src="'+g+'" alt="Bilder des Monats"><img src="'+c+'" alt="Bilder des Monats"><img src="'+p+'" alt="Bilder des Monats"><img src="'+_+'" alt="Bilder des Monats"></p><p>DC8WAN Ich habe eine ungew\xF6hnliche Drausenlocation. In eine Mooney M20k die Portable Funkanlage aufgebaut wurde wird. Die Schlepp Antenne wird durch ein Seitenfenster rausgelassen. Die benutzen Ger\xE4tschaft FT891 mit Z11 Tuner, 1:9 Balun und eine Mandelwellesperre und selbstgebaute Wickler f\xFCr das Aus- und einfahren der Antenne.</p><p><img src="'+h+'" alt="Bilder des Monats"><img src="'+k+'" alt="Bilder des Monats"></p><p>DO1EDK und DB6NL haben am 27.12.24 in einer nebeligen Abendaktion die Kissinger H\xF6he (DE-0816) bei Hamm aktiviert. Ziel war es auf einer gr\xF6\xDFeren Freifl\xE4che mit Bank ca. 40m Draht in die Luft zu bekommen, um die Aktivierung auf 80m zu machen. Mit ein wenig Gl\xFCck k\xF6nnte nach der Planung dank AT-100 auch 160m funktionieren. Die Halde steht ein wenig au\xDFerhalb von Hamm und in dem Nebel war ohne die Kopflampen die Sicht bei nahezu 0m. Nach dem Aufbau der Stationen (FT-891 mit AT-100 am Langdraht, FX-4CR mit HF-P1 f\xFCr FT8 auf 40m) war DK1BOU der Erste, der auf den CQ-Ruf zur\xFCck gekommen ist. Neben seinem eigenen Call kam auch DA0CCC ins Log. Kurz darauf melden sich auch sehr schnell andere Drau\xDFenfunker (DM5XT, DO8PHK, DO7IW, DL2EGS, DF2GN und DL7PIP). Neben den \xFCblichen Rapporten wurden im Smalltalk noch die besten W\xFCnsche zum Jahreswechsel ausgetauscht. Highlight waren auf jeden Fall die beiden P2P-Kontakte mit DF2GN auf 80m und 160m in SSB, der in DE-0865 seine Station bei den widrigen Bedingungen aufgebaut hatte. Insgesamt kamen auf 40m, 80m und 160m 15 QSOs in SSB ins Log. Im wahrsten Sinne war das eine coole Aktion zum Jahresabschluss\u2026</p><p><img src="'+B+'" alt="Bilder des Monats"><img src="'+D+'" alt="Bilder des Monats"><img src="'+v+'" alt="Bilder des Monats"><img src="'+M+'" alt="Bilder des Monats"><img src="'+b+'" alt="Bilder des Monats"><img src="'+f+'" alt="Bilder des Monats"></p>',9),S=[j];function z(A,F){return a(),n("div",null,S)}var L=e(w,[["render",z],["__file","2024-12-30-Bilder-Des-Monats-Dezember.html.vue"]]);export{L as default};
